import React from "react";
import { Menu } from "antd";

const Contacts = ({ contacts, selectedKey, changeSelectKey }) => {
  const contactList = [];
  contacts.forEach((contact, index) =>
    contactList.push(
      <Menu.Item key={index} onClick={changeSelectKey}>
        {contact}
      </Menu.Item>
    )
  );

  return (
    <Menu mode="inline" selectedKey={[selectedKey]}>
      {contactList}
    </Menu>
  );
};

export default Contacts;
